import React from 'react';
import TodoListItem from './TodoListItem';
import { Todo, MapTodo, DeleteTodo } from './../Types/index';
import { makeStyles } from '@material-ui/core/styles';

interface TodoListProps {
    todos: Todo[],
    mapTodo: MapTodo,
    deleteTodo: DeleteTodo
}

var useStyle = makeStyles({
    root: {
        background: "linear-gradient(45deg, #b5e48c, #76c893)",
        margin: "1rem",
        borderRadius: "1rem",
        padding: "1rem",
        boxShadow: "1px 1px 5px 5px grey;"
    }
})

var classOl = useStyle();

const TodoList: React.FC<TodoListProps> = ({ todos, mapTodo, deleteTodo }) => {
    return <ol className={classOl.root} >
        {todos.map(todo => {
            return <TodoListItem todo={todo} mapTodo={mapTodo} deleteTodo={deleteTodo}  />
        })}
    </ol>
}

export default TodoList;
